import React from 'react';


const Home = () => (
  <section className="page home">
    
    <h1>Hi, I am Satyansh</h1>
    <p>Crafted with Purpose. Driven by Passion.</p>
    <h2><center>A former Software Development Engineer with a strong technical foundation, and a
       dedicated and driven aspiring Product Manager passionate about building impactful, user-centric products that bridge technology and business</center></h2>
    
  </section>
);

export default Home;
